class Solution:
    def romanToInt(self, s: str) -> int:
        dic={"I":1, "V":5, "X":10, "L":50, "C":100, "D":500, "M":1000 }
        m,total=dic[s[0]],0
        for i in s:
            n=dic[i]
            total = (total- 2*m + n) if(m<n) else (total+ n)
            m=n
        return total

