class BSTIterator:   

    def __init__(self, root: Optional[TreeNode]):
        self.nodes = []
        self.inorder(root)

    def inorder(self, root):
        if root is None:
            return
        self.inorder(root.left)
        self.nodes.append(root.val)
        self.inorder(root.right)

    def next(self) -> int:
        return self.nodes.pop(0)


    def hasNext(self) -> bool:
        return len(self.nodes) > 0



