class Solution:
    def numIslands(self, grid: List[List[str]]) -> int:
        if not grid:
            return 0
        rows,cols = len(grid),len(grid[0])
        islands = 0
        visit = set()
        # using dfs in 2 methods
        # firstone
        def dfs(r,c):
            if r <0 or r >= rows or c <0 or c >= len(grid[0]) or grid[r][c]!="1" :
                return 
            if (r,c) not in visit:
                visit.add((r,c))
                dfs(r+1,c)
                dfs(r-1,c)
                dfs(r,c+1)
                dfs(r,c-1)

        for r in range(rows):
            for c in range(cols):
                if grid[r][c] == "1" and (r,c) not in visit:
                    dfs(r,c)
                    islands+=1
        return islands

