class Solution:
    def findOrder(self, numCourses: int, prerequisites: List[List[int]]) -> List[int]:
        ans = []
        d = {}
        indegree = {}
        for i in range(numCourses):
            d[i] = []
            indegree[i] = 0

        for i in prerequisites:
            d[i[0]].append(i[1])
            indegree[i[1]] += 1

        queue = []
        for i in indegree:
            if indegree[i] == 0:
                queue.append(i)

        while queue:
            curr = queue.pop(0)
            ans.insert(0,curr)
            for i in d[curr]:
                if indegree[i] > 0:
                    indegree[i]-= 1
                    if indegree[i] == 0:
                        queue.append(i)

        for i in indegree:
            if indegree[i] != 0:
                return []
        return(ans)

