        ans = [1] * len(n)

        pre, pos = 1, 1

        for i in range(len(n)):
            ans[i] = pre
            pre *= n[i]

        for i in range(len(n)-1, -1, -1):
            ans[i] *= pos
            pos *= n[i]

        return ans

class Solution:
    def maxSlidingWindow(self, nums: List[int], k: int) -> List[int]:
        l,r = 0,0
        q = []

        while True:
            if not q:
                q.append(nums[l])
            else:
                while q and nums[r]>=q[-1]:
                    q.pop()
                q.append(nums[r])         
            if r-l+1==k:
                break
            r+=1

        ans = []

        while r!=len(nums):
            maxi = q[0]
            ans.append(maxi)	
            if r+1<len(nums):
                while q and (len(q)==0 or nums[r+1]>q[-1]):
                    q.pop()
                q.append(nums[r+1])  
            if nums[l]==q[0]:
                q.pop(0)
            l+=1
            r+=1
        return ans

