class Solution:
    def numSquares(self, n: int) -> int:
        #check whether n is perfect square
        if int(n**0.5)**2==n:
            return 1
        #collect the possible perfect squares used to construct n
        ps=set()
        i=1
        while i**2<=n:
            ps.add(i**2)
            i+=1
        #create two ends of the bfs
        begin=set()
        begin.add(0)
        end=set()
        end.add(n)
        step=0
        while begin and end:
            step+=1
            temp=set()
            high=max(end)
            for i in begin:
                for j in ps:
                    #check if begin reaches end
                    if (i+j) in end:
                        return step
                    #if i+j>high, it's not possible to be a part of the answer
                    elif i+j<high:
                        temp.add(i+j)
            begin=temp
            step+=1
            temp=set()
            low=min(begin)
            for i in end:
                for j in ps:
                    #check if end reaches begin
                    if (i-j) in begin:
                        return step
                    #if i-j<low, it's not possible to be a part of the answer
                    elif i-j>low:
                        temp.add(i-j)
            end=temp
        return -1

