class Solution:
    def getHint(self, secret: str, guess: str) -> str:
        bulls = 0
        fqs, fqg = {}, {} #frequency table 
        for s, g in zip(secret, guess): 
            if s == g: bulls += 1
            fqs[s] = 1 + fqs.get(s, 0)
            fqg[g] = 1 + fqg.get(g, 0)
        cows = sum(min(v, fqg.get(k, 0)) for k, v in fqs.items()) - bulls
        return f"{bulls}A{cows}B"

