class Solution:
    def removeInvalidParentheses(self, s: str) -> List[str]:
        self.ans = []
        self.minMoves = float('inf')

        @lru_cache(None)
        def rec(s, count):
            if not s or count > self.minMoves:
                return
            elif self.isValid(s):
                if count == self.minMoves:
                    self.ans.append(s)
                else:
                    self.minMoves = count
                    self.ans = [s]

            for i in range(len(s)):
                if s[i] in '()':
                    rec(s[:i] + s[i+1:], count+1)

        rec(s, 0)
        return self.ans or ['']


    def isValid(self, s):
        l, r = 0, 0
        for i in range(len(s)):
            if s[i] == '(': l += 1
            elif s[i] == ')': r += 1

            if r > l: return False

        return r == l

class Solution:
    def solve(self, prices, index, opt):
        if index >= len(prices):
            return 0
        if (index, opt) in self.dp:
            return self.dp[(index, opt)]
        if opt == 0:
            buy = self.solve(prices, index+1, 1) - prices[index]
            cool = self.solve(prices, index+1, 0)
            self.dp[(index, opt)] = max(buy, cool)
        else:
            sell = self.solve(prices, index+2, 0) + prices[index]
            cool = self.solve(prices, index+1, 1)
            self.dp[(index, opt)] = max(sell, cool)
        return self.dp[(index, opt)]

    def maxProfit(self, prices: List[int]) -> int:
        self.dp = {}
        return self.solve(prices, 0, 0)

class Solution:
    def findMinHeightTrees(self, n: int, edges: List[List[int]]) -> List[int]:

        if n<2:
            return range(n)

        graph=defaultdict(set)
        indegree=[0]*n
        for u,v in edges:
            graph[u].add(v)
            graph[v].add(u)
            indegree[u]+=1
            indegree[v]+=1

        queue=[]
        for i in range(n):
            if indegree[i]==1:
                queue.append(i)

        count=n

        while count>2:
            new_queue=[]

            for current in queue:

                for neighbour in graph[current]:
                    indegree[neighbour]-=1
                    graph[neighbour].remove(current)
                    if indegree[neighbour]==1:
                        new_queue.append(neighbour)

                count-=1
            queue=new_queue

        return queue

class Solution:
    def maxCoins(self, nums: List[int]) -> int:
        nums = [1] + nums + [1]
        size = len(nums)        

        t = [[-1 for p in range(0,size+1)]
            for q in range(0,size+1)]

        return self.solve(nums,1,size-1,t)

    def solve(self,arr,i,j,t):
        if i >= j:
            return 0

        if t[i][j] > 0:
            return t[i][j]

        ans = float('-inf')

        for k in range(i,j):
            if t[i][k] != -1:
                left = t[i][k]
            else:
                left = self.solve(arr,i,k,t)
                t[i][k] = left

            if t[k+1][j] != -1:
                right = t[k+1][j]
            else:
                right = self.solve(arr,k+1,j,t)
                t[k+1][j] = right

            temp = left + right + (arr[i-1]*arr[k]*arr[j])

            ans = max(ans,temp)

        t[i][j] = ans
        return t[i][j]

