    def addStrings(self, num1: str, num2: str) -> str:
        if "0" in (num1, num2):
            return num2 if num1 == "0" else num1

        class MyStr(str):
            dic = {str(v): v for v in range(10)}

            def __getitem__(self, index):
                try:
                    return MyStr.dic[super().__getitem__(index)]
                except IndexError:
                    return 0

        num1, num2 = MyStr(num1), MyStr(num2)
