        for i in range(len(s)//(2*k)):
            res += s[2*k*i:2*k*i+k][::-1] + s[2*k*i+k:2*k*(i+1)]

        remainder = len(s) % (2*k)

        if remainder <= k and remainder > 0:
            res += s[-remainder:][::-1]
        elif remainder > k:
            res += s[-remainder:-remainder+k][::-1] + s[-remainder+k:]

        return res

