class Solution:
    def triangleNumber(self, nums: List[int]) -> int:
        nums.sort()
        count=0
        for i in range(len(nums)-2):
            k=i+2
            for j in range(i+1,len(nums)-1):
                if nums[i]==0: continue
                while k<len(nums) and nums[i] + nums[j] > nums[k]:
                    k+=1
                count+=k-j-1
        return count

class Solution:
    def mergeTrees(self, root1: TreeNode, root2: TreeNode) -> TreeNode:
        if root1 == root2 == None:
            return None

        if root1 and root2 == None:
            return root1

        if root2 and root1 == None:
            return root2

        if root1 and root2:
            root = TreeNode(root1.val + root2.val)
            root.left = self.mergeTrees(root1.left, root2.left)
            root.right = self.mergeTrees(root1.right, root2.right)
            return root

class Solution:
    def leastInterval(self, tasks: List[str], n: int) -> int:
        freq = {} # frequency table 
        for x in tasks: freq[x] = 1 + freq.get(x, 0)
        mx = max(freq.values()) # highest frequency
        cnt = sum(v == mx for v in freq.values()) # occurrences of most frequent tasks
        return max(len(tasks), (mx-1)*(n+1) + cnt)

class Solution:
    def addOneRow(self, root: Optional[TreeNode], v: int, d: int) -> Optional[TreeNode]:
        temp=root
        def hii(temp,d):

            if d==2 and temp:
                x=TreeNode(v)
                y=TreeNode(v)
                x.left=temp.left
                y.right=temp.right
                temp.left=x
                temp.right=y
                return root
            else:
                if temp:
                    hii(temp.left,d-1)
                    hii(temp.right,d-1)
            return root

        if d==1:
            x=TreeNode(v)
            x.left=root
            return x

        return hii(temp,d)

