class Solution:
    def kInversePairs(self, n: int, k: int) -> int:
        curr = [0 for _ in range(k+1)]
        prev = [0 for _ in range(k+1)]
        for i in range(1,n+1):
            value = 0
            for j in range(k+1):
                if j == 0:
                    curr[j] = 1
                    value += prev[j]
                else:
                    if j >= i:
                        value-=prev[j-i]
                    value+=prev[j]
                    curr[j] = value
            curr,prev = prev,curr
        return prev[-1] % (10**9+7)

class Solution:
    def scheduleCourse(self, courses: List[List[int]]) -> int:
        prefix = 0 
        pq = [] # max-heap 
        for x, y in sorted(courses, key=lambda x: x[1]): 
            prefix += x
            heappush(pq, -x)
            while prefix > y: prefix += heappop(pq)
        return len(pq)

class Solution:
    def judgeSquareSum(self, c: int) -> bool:
        # Fermat theorem on sum of two squares
        x = 2
        while x*x <= c: 
            if c % x == 0: 
                mult = 0
                while c % x == 0: 
                    mult += 1
                    c //= x
                if x % 4 == 3 and mult &amp; 1: return False 
            x += 1
        return c % 4 != 3

class Solution:
    def exclusiveTime(self, n: int, logs: List[str]) -> List[int]:
        ans = [0] * n
        stk, start = [], None
        for log in logs:
            jid, kw, ts = log.split(':')
            jid, ts = int(jid), int(ts)
            if kw == 'start':
                if stk:
                    ans[stk[-1]] += (ts - start)
                stk.append(jid)
                start = ts
            else:
                ans[stk.pop()] += (ts - start + 1)
                start = ts + 1
        return ans

class Solution:
    def numDecodings(self, s: str) -> int:

        @cache 
        def fn(i): 
            """Return decode ways."""
            if i == len(s): return 1 
            if s[i] == "0": return 0 
            if i == len(s)-1: return 9 if s[i] == '*' else 1
            if s[i] == "*": 
                ans = 9*fn(i+1)
                if s[i+1] == "*": ans += 15*fn(i+2)
                else: 
                    ans += fn(i+2)
                    if s[i+1] <= "6": ans += fn(i+2)
            else: 
                ans = fn(i+1)
                if s[i+1] == "*": 
                    if s[i] == "1": ans += 9*fn(i+2)
                    elif s[i] == "2": ans += 6*fn(i+2)
                elif int(s[i:i+2]) <= 26: ans += fn(i+2)
            return ans % 1_000_000_007

        return fn(0)

class Solution:
    def solveEquation(self, equation: str) -> str:
        s = ''
        x, i = 0, 0
        rev = False

        for c in equation:
            if c in '+-':
				if s:
					i += int(s or 0) * (rev or -1)
                s = c
            elif c == 'x':
                x -= int(s+'1' if s in '+-' else s) * (rev or -1)
                s = ''
            elif c == '=':
			    if s:
					i -= int(s or 0)
					s = ''
                rev = True
            else:
                s += c
        else:
		    if s:
				i += int(s or 0) * (rev or -1)
            return f'x={i//x}' if x else 'No solution' if i else 'Infinite solutions'

class Solution:
    def findMaxAverage(self, nums: List[int], k: int) -> float:
        sums, ans = 0, float("-inf")
        i = 0
        for j in range(len(nums)):
            sums += nums[j]
            if j-i+1 == k:
                ans = max(ans, sums)
                sums -= nums[i]
                i = i+1
        return ans / k

class Solution:
def findLongestChain(self, pairs: List[List[int]]) -> int:
    n=len(pairs)
    dp=[1]*n
    pairs=sorted(pairs,key=lambda k:k[0])
    for i in range(1,n):
        for j in range(0,i):
            if pairs[i][0]>pairs[j][1] and dp[i]<dp[j]+1:
                dp[i]=dp[j]+1
    return max(dp)

class Solution:
