        for l in range(len(s)):
            count += Solution.check(l,l,s)
            count += Solution.check(l,l+1,s)

        return count

    @staticmethod
    def check(l, r, s):
        count = 0
        while(l>=0 and r<len(s)):
            if s[l] == s[r]:
                count +=1
