class Solution:
    def isPossible(self, nums: List[int]) -> bool:
        freq = {}
        for x in nums: freq[x] = 1 + freq.get(x, 0) # frequency table of nums

        seen = deque()
        for i, x in enumerate(nums):
            if i == 0 or nums[i-1] != x: 
                if (n := freq[x] - freq.get(x-1, 0)) > 0: seen.extend([x]*n)
                elif any(x - seen.popleft() < 3 for _ in range(-n)): return False 
                if not freq.get(x+1, 0) and any(x - seen.popleft() < 2 for _ in range(freq[x])): return False 
        return True

class Solution:
    def imageSmoother(self, M: List[List[int]]) -> List[List[int]]:
        m, n = len(M), len(M[0])
        # Calculate sums in the same row.
        for i in range(m):
            tmp = M[i][0]
            for j in range(1, n):
                value = M[i][j]
                M[i][j - 1] += value
                M[i][j] += tmp
                tmp = value

        # Calculate the sums by columns.
        for j in range(n):
            tmp = M[0][j]
            for i in range(1, m):
                value = M[i][j]
                M[i - 1][j] += value
                M[i][j] += tmp
                tmp = value

        # Calulate the number of cells.
        for i in range(m):
            x = 3 - (1 if i == 0 else 0) - (1 if i == m - 1 else 0)
            for j in range(n):
                y = 3 - (1 if j == 0 else 0) - (1 if j == n - 1 else 0)
                M[i][j] //= x * y
        return M

class Solution:
    def widthOfBinaryTree(self, root: TreeNode) -> int:
        if not root:
            return 0
        L=[[root]]
        V=[[0]]
        while L[-1]:
            R=[]
            S=[]
            for i in range(len(L[-1])):
                if L[-1][i].left:
                    S.append(2*V[-1][i])
                    R.append(L[-1][i].left)
                if L[-1][i].right:
                    S.append(2*V[-1][i]+1)
                    R.append(L[-1][i].right)
            V.append(S)
            L.append(R)
        v=[S[-1]-S[0]+1 for S in V if S]
        return max(v)

class Solution:
    def strangePrinter(self, s: str) -> int:
        s = "".join(ch for i, ch in enumerate(s) if i == 0 or s[i-1] != ch)

        @cache
        def fn(lo, hi): 
            """Return min ops to print s[lo:hi]."""
            if lo == hi: return 0
            ans = 1 + fn(lo+1, hi)
            for mid in range(lo+1, hi): 
                if s[lo] == s[mid]: 
                    ans = min(ans, fn(lo, mid) + fn(mid+1, hi))
            return ans 

        return fn(0, len(s))

class Solution:
    def checkPossibility(self, nums: List[int]) -> bool:
        changes = 0
        for i, j in zip(range(0, len(nums) - 1), range(1, len(nums))):
            if nums[j] < nums[i]:
                lchanges, rchanges = 0, 0
                for x in reversed(range(0, j)):
                    if nums[x] > nums[j]:
                        lchanges += 1
                        if lchanges == 2:
                            break;
                    else:
                        break
                for y in range(j, len(nums)):
                    if nums[y] < nums[i]:
                        rchanges += 1
                        if rchanges == 2:
                            break
                    else:
                        break
                changes += min(lchanges, rchanges)
                if changes >= 2:
                    return False
        return True

