class Solution:
    def cutOffTree(self, forest: List[List[int]]) -> int:
        a = []
        n = len(forest)
        m = len(forest[0])
        for i in range(n):
            for j in range(m):
                if forest[i][j] > 1:
                    a.append(forest[i][j])
        a.sort()

        s = 0
        ux = 0
        uy = 0
        for h in a:
            if forest[ux][uy] == h:
                continue        
            dist = [[None] * m for i in range(n)]
            q = deque()
            q.append((ux, uy))
            dist[ux][uy] = 0
            found = False
            while q and not found:
                ux, uy = q.popleft()
                d = [(-1, 0), (0, 1), (1, 0), (0, -1)]
                for dx, dy in d:
                    vx = ux + dx
                    vy = uy + dy
                    if vx < 0 or vx >= n or vy < 0 or vy >= m:
                        continue
                    if forest[vx][vy] == 0:
                        continue
                    if dist[vx][vy] is None:
                        dist[vx][vy] = dist[ux][uy] + 1
						# It's important to stop here! Otherwise there will be TLE
                        if forest[vx][vy] == h:
                            s += dist[vx][vy]
                            ux = vx
                            uy = vy
                            found = True
                            break
                        q.append((vx, vy))
            if not found:
                return -1
        return s

class Solution:
    def valid(self, s, stack=[]):
        i, l = 0, len(s)
        if not l:
            return True

        while i<l:
            c = s[i]
            if c == '(':
                stack.append(c)

            elif c == ')':
                if stack and stack[-1] == '(':
                    stack.pop()
                else:
                    return False

            else:
                sub = s[i+1:]
                return (self.valid('('+sub, stack[:])
                       or self.valid(')'+sub, stack[:])
                       or self.valid(sub, stack[:]))

            i += 1

        return True if len(stack)==0 else False


    def checkValidString(self, s: str) -> bool:
        return self.valid(s)

class Solution:
    def validPalindrome(self, s: str) -> bool:
        n=len(s)
        left,right=0,n-1
        cnt=0
        while left<=right:
            if s[left]==s[right]:
                left+=1
                right-=1
            else:
                if cnt==1:
                    return False
                else:
                    if self.check(s,left+1,right):
                        left+=1
                    elif self.check(s,left,right-1):
                        right-=1
                    else:
                        return False
                    cnt+=1
        return True
    def check(self,s,left,right):
        if s[left:right+1]==s[left:right+1][::-1]:
            return True
        return False

