class Solution:
    def findShortestSubArray(self, nums: List[int]) -> int:
        d = {}
        m, j, count = 1, [nums[0]], []
        for i in nums:
            if i not in d:
                d[i] = 1
            else:
                d[i] += 1
                if d[i] > m:
                    m = d[i]
                    j = [i]
                elif d[i] == m:
                    j.append(i)
        for i in j:
            count.append(len(nums) - nums[::-1].index(i) - nums.index(i))
        return min(count)

class Solution:
    def canPartitionKSubsets(self, nums: List[int], k: int) -> bool:
        total = sum(nums)
        if total % k: return False 

        avg = total // k

        @cache
        def fn(x, mask):
            """Return True if available elements can be parititioned."""
            if x > avg: return False 
            if x == avg: return fn(0, mask)
            if not mask: return True 
            for i in range(len(nums)): 
                if mask &amp; 1<<i and fn(x + nums[i], mask ^ 1<<i): return True 
            return False 

        nums.sort(reverse=True)
        return fn(0, (1 << len(nums))-1)

