class Solution:
    def search(self, nums: List[int], target: int) -> int:
        low = 0
        high = len(nums)-1
        loc = -1
        while (low <= high):
            mid = (high+low)//2
            if nums[mid] == target:
                return mid
            if nums[mid] > target:
                high = mid-1
            elif nums[mid] < target:
                low = mid+1
        return loc

