class Solution:
    def splitListToParts(self, head: Optional[ListNode], k: int) -> List[Optional[ListNode]]:
        n = 0
        current = head
        while (current):
            n += 1
            current = current.next

        parts = []
        for k in range(k, 0, -1):
            partSize = ceil(n / k)
            nextNode = head
            for _ in range(partSize - 1):
                if (not nextNode): break
                nextNode = nextNode.next
            parts.append(head)
            if (nextNode):
                head = nextNode.next
                nextNode.next = None
            n -= partSize

        return parts

