        def fn(i, j): 
            """Return True if grid[i-1:i+2][j-1:j+2] is a magic squre."""
            seen = set()
            row, col = [0]*3, [0]*3 # row sum &amp; column sum 
            diag = anti = 0
            for ii in range(i-1, i+2):
