class Solution:
    def reorderedPowerOf2(self, N: int) -> bool:
        def str2dict(s):
            d = {}
            for i, e in enumerate(s):
                if e in d:
                    d[e] = d[e] + 1
                else:
                    d[e] = 1
            return d

        s = str(N)
        l = len(s)
        d = str2dict(s)

        i = 0
        result = False
        while not result:
            two_power = 2**i
            s_two_power = str(two_power)
            if len(s_two_power) == l:
                result = str2dict(s_two_power) == d
            elif len(s_two_power) > l:
                break
            i += 1
        return result

