class Solution:
    def possibleBipartition(self, N: int, dislikes: List[List[int]]) -> bool:

        d = deque([])
        colors = {}

        graph = {i: [] for i in range(1, N+1)}

        for a, b in dislikes:
            graph[a].append(b)
            graph[b].append(a)

        for i in graph.keys():

            if i not in colors:
                colors[i] = 1
                d.append(i)

                while d:

                    item = d.popleft()
                    for ch in graph[item]:

                        if ch in colors:
                            if colors[ch] == colors[item]:
                                return False
                        else:
                            colors[ch] = 1 - colors[item]
                            d.append(ch)
        return True

