class Solution:
    def intervalIntersection(self, A: List[List[int]], B: List[List[int]]) -> List[List[int]]:
        LA, LB, I, i, j = len(A), len(B), [], 0, 0
        while i < LA and j < LB:
            a, b, i = A[i], B[j], i + 1
            if a[1] > b[1]: a, b, i, j = b, a, i - 1, j + 1
            if b[0] <= a[1]: I.append([max(a[0],b[0]),a[1]])
        return I


