class Solution:
    def clumsy(self, n: int) -> int:
        if n == 1 or n == 2:
            return n
        if n >= 3:
            fact = n * (n - 1) // (n - 2)
            n -= 3
        while n - 4 >= 0:
            fact = fact + n - (n - 1) * (n - 2) // (n - 3)
            n -= 4
        if n > 0:
            fact += n
            n = n - 1
            if n > 0:
                fact -= n
                n = n- 1
        return fact

