            node = preorder[i]
            root = self.handle(root, node)
        return root

    def handle(self, root, x):
        if not root:
            return TreeNode(x)
        if x < root.val:
            root.left = self.handle(root.left, x)
        else:
            root.right = self.handle(root.right, x)
        return root

