        def canShip(capacity: int) -> bool:
            nonlocal D
            count = 1
            loaded = 0 
            for w in weights:
                if loaded + w <= capacity:
                    loaded += w
                else:
                    count += 1
                    loaded = w
            return count <= D


        maxWeight = max(weights)
        lo = sum(weights) // D
        hi = maxWeight * len(weights) // D + 1
