class Solution:
    winnums = []
    losenums = [1]

    def divisorGame(self, N: int) -> bool:
        if self.calcGame(N) >=0 :
            return True
        else:
            return False

    def calcGame(self, N):
        divisors = []

        if N in self.winnums:
            return 1
        if N in self.losenums:
            return -1

        for num in range(1,N):
            if N % num == 0:
                divisors.append(num)
        if len(divisors)==0:
            self.losenums.append(N)
            return -1


        for divisor in divisors:
            newNum = N-divisor
            profit = - self.calcGame(newNum)

            if profit == 0:
                continue
            if profit >= 0:
                self.winnums.append(N)
                return 1

        self.losenums.append(N)
        return -1

