        j = trips[0][1]
        se = collections.defaultdict(int)
        while i< len(trips):
            capacity+=se[j]
            del se[j]
            if j == trips[i][1]:
                se[trips[i][2]] += trips[i][0]
                capacity-= trips[i][0]
                i+=1
                if capacity<0:
                    return False

            else:
                j+=1
        return True

