class Solution:
    def longestDecomposition(self, text: str) -> int:
        import re
        groups = 0
        while True:
            match = re.fullmatch(r'(\w+?).*\1', text)
            if match:
                groups += 2
                subend = match.end(1)
                text = text[subend:-subend]
            else:
