class Solution:
    def criticalConnections(self, n: int, connections: List[List[int]]) -> List[List[int]]:
        graph = [[] for _ in range(n)]
        group = [None] * n

        for n1, n2 in connections:
            graph[n1].append(n2)
            graph[n2].append(n1)

        def dfs(node, parent):
            group[node] = node
            for neighbor in graph[node]:
                if neighbor == parent:
                    continue
                elif group[neighbor] is None:
                    dfs(neighbor, node)
                    if group[neighbor] != neighbor:
                        group[node] = group[neighbor]
                else:
                    if group[neighbor] < group[node]:
                        group[group[node]] = group[neighbor]
                    else:
                        group[group[neighbor]] = group[node]

        def get_root_parent(node):
            if group[node] == node:
                return node
            group[node] = get_root_parent(group[node])
            return group[node]

        dfs(0, 0)

        for i in range(n):
            group[i] = get_root_parent(i)

        return [conn for conn in connections if group[conn[0]] != group[conn[1]]]

