class Solution:
    def oddCells(self, n: int, m: int, indices: List[List[int]]) -> int:
        row = set()
        col = set()
        ans = 0
        for i, j in indices:
            diff = m - 2 * len(col)
            ans += diff * (-1) ** (i in row) 
            row ^= {i}
            diff = n - 2 * len(row)
            ans += diff * (-1) ** (j in col) 
