    def countSquares(self, matrix: List[List[int]]) -> int:
        total = 0
        dp = [[0] * len(row) for row in matrix]
        for i, row in enumerate(matrix):
            for j, num in enumerate(row):
                if not num:
                    continue
                upper = 0
                if i-1 >= 0:
                    upper = dp[i-1][j]
                left = 0
                if j-1 >= 0:
                    left = dp[i][j-1]
                diag = 0
                if i-1 >= 0 and j-1 >= 0:  # Can this be made less redundant?
