class Solution:
    def shortestPath(self, G: List[List[int]], k: int) -> int:
        M, N, P, Q, D, L = len(G)-1, len(G[0])-1, [(0,0,0)], [], {}, 0
        if k >= M+N: return M+N
        while P:
            for (x,y,s) in P:
                if (x,y) == (M,N): return L
                for i,j in (x-1,y),(x,y+1),(x+1,y),(x,y-1):
                    if 0<=i<=M and 0<=j<=N:
                        t = s + G[i][j]
                        if t <= k and D.get((i,j),math.inf) > t: D[(i,j)], _ = t, Q.append((i,j,t))
            P, Q, L = Q, [], L + 1
        return -1


