class Solution:
    def removeLeafNodes(self, root: TreeNode, target: int) -> TreeNode:

        def helper(node):
            if node:    
                node.left = helper(node.left)
                node.right = helper(node.right)

                if not node.left and not node.right and node.val == target:
                    return None
                else:
                    return node

        return helper(root)

class Solution:
    def minTaps(self, n: int, ranges: List[int]) -> int:
        intervals = [(0, ranges[0])]
        for i in range(1, n + 1):
            l, r = max(i - ranges[i], 0), i + ranges[i]
            if intervals[-1][1] < r:
                while intervals and intervals[-1][0] >= l:
                    intervals.pop()
                if not intervals:
                    intervals.append((l, r))
                elif intervals[-1][1] < n and l <= intervals[-1][1]:
                    intervals.append((intervals[-1][1], r))
		return len(intervals) if intervals[-1][1] >= n else -1

class Solution:
    def diagonalSort(self, mat: List[List[int]]) -> List[List[int]]:

        diag = {}
        m = len(mat)
        n = len(mat[0])

        for row in range(m):
            for col in range(n):
                diag.setdefault(col-row, [])
                diag[col-row].append(mat[row][col])

        for key, val in diag.items():
            diag[key] = sorted(val)

        for row in range(m):
            for col in range(n):
                mat[row][col] = diag[col-row].pop(0)

        return mat

