class Solution:
    def isPossible(self, target: List[int]) -> bool:
        n = len(target)
        sumk = 0
        for x in sorted(target):
            if x == 1:
                continue
            if (x-1) % (n-1) != 0:
                return False
            k = (x-1)//(n-1)
            if not k > sumk:
                return False
            sumk += k
        return True

class Solution:
    def count1s(self, num):
        count = 0
        while num >= 1:
            if num%2: count += 1
            num = num//2
        return count
    def cmp(self, vals):
        l,r = vals
        return r * 10000 + l

    def sortByBits(self, arr: List[int]) -> List[int]:
        new_arr = [[arr[i], self.count1s(arr[i])] for i,_ in enumerate(arr)]
        sorted_new_arr = sorted(new_arr, key = self.cmp)
        result = [sorted_new_arr[i][0] for i,_ in enumerate(sorted_new_arr)]
        return result

