        nums = [a, b, c]
        chars = ['a', 'b', 'c']
        indices = [0, 1, 2]
        def keyFunc(i):
            return nums[i]
        indices = sorted(indices, key=keyFunc)
        if nums[indices[2]] > (nums[indices[1]] + nums[indices[0]] + 1) * 2:
            nums[indices[2]] = (nums[indices[1]] + nums[indices[0]] + 1) * 2
        if nums[indices[2]] > nums[indices[1]] + nums[indices[0]] + 1:
            s = ""
            gaps = nums[indices[1]] + nums[indices[0]] + 1
            doubles = nums[indices[2]] % gaps
            if doubles == 0:
                doubles = gaps
            singles = nums[indices[2]] - doubles
            for k in [0, 1]:
                for i in range(nums[indices[k]]):
                    if doubles > 0:
                        s += chars[indices[2]]
                        doubles -= 1
                    s += chars[indices[2]]
                    s += chars[indices[k]]
            if doubles > 0:
                s += chars[indices[2]]
            s += chars[indices[2]]
            return s
        else:
            s = ""
            singles = nums[indices[2]]
            gaps = nums[indices[1]] + nums[indices[0]] + 1
            zeros = gaps - singles
            skip = True
            for k in [0, 1]:
                for i in range(nums[indices[k]]):
                    if zeros > 0 and skip:
                        zeros -= 1
                    else:
                        s += chars[indices[2]]
                    s += chars[indices[k]]    
                    skip = not skip
            if not(zeros > 0 and skip):
                s += chars[indices[2]]
            return s

class Solution:
    def stoneGameIII(self, s: List[int]) -> str:
        n = len(s)
        dpi = 0
        dp1 = 0
        dp2 = 0
        i = n-1
        while i >= 0:
            ans = -1<<32
            ans = max(ans,s[i]-dpi)
            if i+1 < n:
                ans = max(ans,(s[i]+s[i+1])-dp1)
            if i+2 < n:
                ans = max(ans,(s[i]+s[i+1]+s[i+2])-dp2)
            dp2 = dp1
            dp1 = dpi
            dpi = ans
            i -= 1
        if dpi > 0:
            return "Alice"
        if dpi == 0:
            return "Tie"
        return "Bob"

