class Solution:
    def minDays(self, bloomDay: List[int], m: int, k: int) -> int:
        if len(bloomDay) < m*k:
            return -1

        l = 1
        r = max(bloomDay)

        while l < r:
            mid = l + (r-l) // 2
            if self.condition(mid,bloomDay,k,m):
                r = mid
            else:
                l = mid+1
        return l



    def condition(self,n,nums,k,m):
        bouquets = 0
        flowers = 0
        for flower in nums:
            if flower <= n:
                bouquets += (flowers + 1) // k
                flowers = (flowers + 1) % k    
            else:
                flowers = 0

        return bouquets >= m

