class Solution:
    def numSplits(self, s: str) -> int:
        tail_d, head_d, ans = {}, {}, 0

        def add_c(d, c):
            if c not in d:
                d[c] = 1
            else:
                d[c] += 1

        def remove_c(d, c):
            n = d[c]
            n -= 1
            if n == 0:
                del d[c]
            else:
                d[c] = n

        def is_same(d1, d2):
            return len(d1) == len(d2)

        # 0) Initialize tail_d
        for c in s:
            add_c(tail_d, c)


        # 1) Start searching number of good ways of split        
        for c in s:
            remove_c(tail_d, c)
            add_c(head_d, c)
            if is_same(tail_d, head_d):
                ans += 1

            if len(tail_d) < len(head_d):
                break

        # 3) Return the answer
        return ans

