                    stack.pop()
                stack.append(1)
            else:
                if not stack:
                    ret += 1
                    stack.append(1)
                if stack[- 1]:
                    stack[- 1] -= 1
                else:
                    stack.pop()
        while stack:
            ret += 1 + stack.pop()
        return ret

