class Solution:
    def findKthBit(self, n: int, k: int) -> str:
        '''
        length pattern:
            1-1
            2-2*1+1=3=2**2-1
            3-2*3+1=7=2**3-1
            4-2*7+1=15=16-1=2**4-1
            n-2**n-1
        k-th bit:
            k<2**(n-1)
        '''
        def helper(n,k):
            if n==1:
                return 0
            elif k==2**(n-1):
                return 1
            elif k<2**(n-1):
                return helper(n-1,k)
            else:
                return 1-helper(n-1,2**(n-1)-(k-2**(n-1)))
        return str(helper(n,k))

