        memo = dict()
        def minimumDays(n):
            if n in memo:
                return memo[n]

            if n == 1:
                return 1
            if n== 2 or n == 3:
                return 2

            memo[n] = min(n%2+minimumDays(n//2)+1, n%3+minimumDays(n//3)+1)

            return memo[n]

        return minimumDays(n)

