                for j in range(a+1,b):
                    rounds.append(j)
            else:
                for j in range(a+1,n+1):
                    rounds.append(j)
                for j in range(1,b):
                    rounds.append(j)
        m = 0
        v = []
        d = Counter(rounds)
        for i in d:
            if d[i] > m-1:
                v.append(i)
                m = d[i]
        return sorted(v)

