class Solution:
    def canChoose(self, groups: List[List[int]], nums: List[int]) -> bool:
        groups_n = sum(len(group) for group in groups)
        nums_n = len(nums)

        if groups_n > nums_n:
            return False

        i = 0
        for group in groups:
            n = len(group)
            while nums_n - i >= n:
                if nums[i:i+n] == group:
                    break
                i += 1
            if nums_n - i < n:
                return False
            else:
                i += n
        return True

class Solution:
    def highestPeak(self, isWater: List[List[int]]) -> List[List[int]]:
        queue = deque()
        rows = len(isWater)
        cols = len(isWater[0])

        for i in range(rows):
            for j in range(cols):
                if isWater[i][j] == 1:
                    queue.append((i,j))
                    isWater[i][j] = 0 # set height of water as 0
                else:
                    isWater[i][j] = '$' # mark the land

        while queue:
            row, col = queue.popleft()

            for x, y in [(0,1),(1,0),(0,-1),(-1,0)]:
                nRow = row + x
                nCol = col + y

                if 0<=nRow<rows and 0<=nCol<cols and isWater[nRow][nCol] == '$':
                    isWater[nRow][nCol] = isWater[row][col]+1
                    queue.append((nRow, nCol))

        return isWater

class Solution:
    def getCoprimes(self, nums: List[int], edges: List[List[int]]) -> List[int]:

        gcdset = [set() for i in range(51)]
        for i in range(1,51):
            for j in range(1,51):
                if math.gcd(i,j) == 1:
                    gcdset[i].add(j)
                    gcdset[j].add(i)

        graph = defaultdict(list)
        for v1, v2 in edges:
            graph[v1].append(v2)
            graph[v2].append(v1)

        ans = [-1]*len(nums)
        q = [[0, {}]]
        seen = set([0])
        depth = 0
        while q:
            temp = []
            for node, ancestors in q:
                index_depth = (-1,-1)
                for anc in list(ancestors.keys()):
                    if anc in gcdset[nums[node]]:
                        index, d = ancestors[anc]
                        if d > index_depth[1]:
                            index_depth = (index,d)
                ans[node] = index_depth[0]

                copy = ancestors.copy()
                copy[nums[node]] = (node,depth)

                for child in graph[node]:
                    if child not in seen:
                        seen.add(child)
                        temp.append([child, copy])
            q = temp
            depth += 1
        return ans
