class Solution:
    def largestPathValue(self, colors: str, edges: List[List[int]]) -> int:
        d = defaultdict(list)
        for v1, v2 in edges:
            d[v1].append(v2)
        visited = {}
        counts = [[0] * 26 for _ in range(len(colors))]
        stack = []
        global_max = 0
        for root in d.keys():
            if root in visited:
                continue
            stack.append(root)
            while stack:
                v1 = stack[-1]
                if v1 in visited:
                    if visited[v1] == 1:
                        visited[v1] = 2
                        stack.pop()
                        if v1 in d:
                            for v2 in d[v1]:
                                for c in range(26):
                                    counts[v1][c] = max(counts[v1][c], counts[v2][c])
                        counts[v1][ord(colors[v1])-ord('a')] += 1
                else:
                    visited[v1] = 1
                    if v1 in d:
                        for v2 in d[v1]:
                            if v2 in visited:
                                if visited[v2] == 1:
                                    return -1
                            else:
                                stack.append(v2)
            global_max = max(global_max, max(counts[root]))
        if global_max == 0 and len(d) < len(colors): # in case input is like ("abcde", [])
            global_max = 1
        return global_max

