class Solution:
def findRotation(self, matrix: List[List[int]], target: List[List[int]]) -> bool:

    def transpose(mat):
        n=len(mat)
        for i in range(n):
            for j in range(i,n):
                mat[i][j],mat[j][i]=mat[j][i],mat[i][j]

    def reverse(mat):
        n=len(mat)
        for i in range(n):
            for j in range(n//2+n%2):
                mat[i][j],mat[i][n-j-1]=mat[i][n-j-1],mat[i][j]

    if target==matrix:
        return True
    # Rotating 1st time
    transpose(matrix)
    reverse(matrix)
    if target==matrix:
        return True
    # Rotating 2nd time
    transpose(matrix)
    reverse(matrix)
    if target==matrix:
        return True
    # Rotating 3rd time
    transpose(matrix)
    reverse(matrix)
    if target==matrix:
        return True

    return False

