            odd = int(num[idx]) % 2
            while odd and idx > -1:
                val = num[idx] + val
                idx -= 1
            idx -= 1
        return val

class Solution:
    def numberOfRounds(self, startTime: str, finishTime: str) -> int:
        start_time = sum(t if i else 60 * t
                         for i, t in enumerate(map(int, startTime.split(":"))))
        finish_time = sum(t if i else 60 * t
                          for i, t in enumerate(map(int, finishTime.split(":"))))
        if finish_time < start_time:
            finish_time += 1440
        return (floor(finish_time / 15) - ceil(start_time / 15)
                if finish_time - start_time >= 15 else 0)

class Solution:
    def countSubIslands(self, grid1: List[List[int]], grid2: List[List[int]]) -> int:

        rows = len(grid1)
        cols = len(grid1[0])
        directions = [(1,0),(-1,0),(0,1),(0,-1)]

        islands = 0

        for row in range(rows):
            for col in range(cols):
                if grid2[row][col] == 1 and grid1[row][col] == 1:
                    grid2[row][col] = '#'
                    q = collections.deque([])
                    q.append((row, col))
                    is_island = True
                    while q:
                        r, c = q.popleft()
                        for y, x in directions:
                            nr = r + y
                            nc = c + x
                            if 0 <= nr < rows and 0 <= nc < cols and grid2[nr][nc] == 1:
                                if grid1[nr][nc] != 1:
                                    is_island = False
                                grid2[nr][nc] = '#'
                                q.append((nr, nc))

                    if is_island:
                        islands += 1

        return islands

class Solution:
    def minDifference(self, nums: List[int], queries: List[List[int]]) -> List[int]:
        loc = {}
        for i, x in enumerate(nums): loc.setdefault(x, []).append(i)
        keys = sorted(loc)

        ans = []
        for l, r in queries: 
            prev, val = 0, inf
            for x in keys: 
                i = bisect_left(loc[x], l)
                if i < len(loc[x]) and loc[x][i] <= r: 
                    if prev: val = min(val, x - prev)
                    prev = x 
            ans.append(val if val < inf else -1)
        return ans

