class Solution:
    def rotateGrid(self, grid: List[List[int]], k: int) -> List[List[int]]:
        m, n = len(grid), len(grid[0])
        ans = [[0] * n for _ in range(m)]
        # x, y is starting point; m, n is desired length and width of the layer
        def helper(x, y, l, w):
            tmp = deque([grid[x][y]])
            a, b = 0, 0
            # extract all number in the layer
            while len(tmp) < 2 * (l + w) - 4:
                if a == 0 and b < w - 1:
                    b += 1
                elif b == w - 1 and a < l - 1:
                    a += 1
                elif a == l - 1 and b > 0:
                    b -= 1
                elif b == 0 and a > 0:
                    a -= 1
                tmp.append(grid[x + a][y + b])

            # rotate counter-clockwise
            tmp.rotate(len(tmp) - k % len(tmp))

            # reassign
            a, b = 0, 0
            ans[x][y] = tmp.popleft()
            while tmp:
                if a == 0 and b < w - 1:
                    b += 1
                elif b == w - 1 and a < l - 1:
                    a += 1
                elif a == l - 1 and b > 0:
                    b -= 1
                elif b == 0 and a > 0:
                    a -= 1
                ans[x + a][y + b] = tmp.popleft()

        x, y = 0, 0
        while m >= 2 and n >= 2:
            helper(x, y, m, n)
            x += 1
            y += 1
            m -= 2
            n -= 2

        return ans

class Solution:
    def waysToBuildRooms(self, prevRoom: List[int]) -> int:
        tree = defaultdict(list)
        for i, x in enumerate(prevRoom): tree[x].append(i)

        def fn(n): 
            """Return number of nodes and ways to build sub-tree."""
            if not tree[n]: return 1, 1 # leaf 
            c, m = 0, 1
            for nn in tree[n]: 
                cc, mm = fn(nn)
                c += cc
                m = (m * comb(c, cc) * mm) % 1_000_000_007
            return c+1, m

        return fn(0)[1]

