class Solution:
    cache = {1:0, 2:0, 3:0, 4:0}

    def countTriples(self, n: int) -> int:        
        if n in self.cache.keys():
            return self.cache[n]
        else:
            self.cache[n] = self.findTriples(n) + self.countTriples(n-1)
            return self.cache[n]

    def findTriples(self, n: int) -> int:
        count = 0

        for a in range(0, n):
            for b in range(a, n):
                if self.isSquareTriple(a, b, n):
                    count += 1

        return count*2

    def isSquareTriple(self, a: int, b: int, c: int) -> bool:
        if ((a*a) + (b*b) == (c*c)):
            return True
        else:
            return False

class Solution:
    def nearestExit(self, maze, entrance) -> int:
        '''
        for val in maze:
            print(val)
        '''
        m, n = len(maze), len(maze[0])
        q, ans = [entrance], 0

        while q:
            num = len(q)
            for i in range(num):
                x, y = q[0]
                if (x == 0 or y == 0 or x == m - 1 or y == n - 1) and ans > 0:
                    return ans
                q.pop(0)
                maze[x][y] = '+'
                if x > 0 and maze[x - 1][y] == '.':
                    q.append([x - 1, y])
                if y > 0 and maze[x][y - 1] == '.':
                    q.append([x, y - 1])
                if x < m - 1 and maze[x + 1][y] == '.':
                    q.append([x + 1, y])
                if y < n - 1 and maze[x][y + 1] == '.':
                    q.append([x, y + 1])
            ans += 1

        return -1

