class Solution:
def minStoneSum(self, piles: List[int], k: int) -> int:

    local = [-p for p in piles]
    heapq.heapify(local)
    for i in range(k):
        tmp = -1*heapq.heappop(local)
        tmp = (tmp+1)//2
        heapq.heappush(local,-tmp)

    return -sum(local)

