class Solution(object):
    def maxMatrixSum(self, matrix):
        """
        :type matrix: List[List[int]]
        :rtype: int
        """
        n = len(matrix)
        s = 0 
        s_abs = 0 
        neg = 0 
        maxneg = float('-inf')
        minabs = float('inf')
        for i in range(n):
            for j in range(n):
                s += matrix[i][j]
                s_abs += abs(matrix[i][j])
                if matrix[i][j] <= 0:
                    neg += 1
                if abs(matrix[i][j]) < abs(minabs):
                    minabs = matrix[i][j]

        if neg % 2 == 0:
            return s_abs
        else:
            return s_abs - 2*abs(minabs)

class Solution:
    def countPaths(self, n: int, roads: List[List[int]]) -> int:
        g = defaultdict(set)
        deg = [0] * n
        for u, v, t in roads:
            if u > v:
                u, v = v, u
            g[u].add((v, t))
            deg[v] += 1

        vis = defaultdict(lambda: float('inf'), {0: 0})
        q = [(0, 0)]
        ways = [0] * n
        ways[0] = 1
        while q:
            t, cur = heappop(q)
            for nei, nei_t in g[cur]:
                deg[nei] -= 1
                if vis[nei] > t + nei_t:
                    vis[nei] = t + nei_t
                    ways[nei] = ways[cur]
                elif vis[nei] == t + nei_t:
                    ways[nei] += ways[cur]

                # only traverse if degree = 0 or spent time starts to exceed minimum
                if deg[nei] == 0 or vis[nei] < t + nei_t:
                    if nei == n - 1 and deg[nei] == 0:
                        return ways[-1] % (10 ** 9 + 7)
                    heappush(q, (vis[nei], nei))

        return ways[-1]

class Solution:
    def numberOfCombinations(self, num: str) -> int:
        n = len(num)
        lcs = [[0]*(n+1) for _ in range(n)]
        for i in reversed(range(n)): 
            for j in reversed(range(i+1, n)): 
                if num[i] == num[j]: lcs[i][j] = 1 + lcs[i+1][j+1]

        def cmp(i, j, d): 
            """Return True if """
            m = lcs[i][j]
            if m >= d: return True 
            return num[i+m] <= num[j+m]

        dp = [[0]*(n+1) for _ in range(n)]
        for i in range(n): 
            if num[i] != "0": 
                for j in range(i+1, n+1): 
                    if i == 0: dp[i][j] = 1
                    else: 
                        dp[i][j] = dp[i][j-1]
                        if 2*i-j >= 0 and cmp(2*i-j, i, j-i): dp[i][j] += dp[2*i-j][i]
                        if 2*i-j+1 >= 0 and not cmp(2*i-j+1, i, j-i-1): dp[i][j] += dp[2*i-j+1][i]
        return sum(dp[i][n] for i in range(n)) % 1_000_000_007

