        mask = 0b1
        for row in mat: 
            temp = 0
            for x in row: temp |= mask << x
            mask = temp 

        for x in range(5000): 
            if mask >> (target+x) &amp; 1 or x <= target and mask >> (target-x) &amp; 1: return x

class Solution:
    def recoverArray(self, n: int, sums: List[int]) -> List[int]:
        sums.sort()
        ans = []
        for _ in range(n): 
            diff = sums[1] - sums[0]
            ss0, ss1 = [], []
            freq = defaultdict(int)
            on = False 
            for i, x in enumerate(sums): 
                if not freq[x]: 
                    ss0.append(x)
                    freq[x+diff] += 1
                    if x == 0: on = True 
                else: 
                    ss1.append(x)
                    freq[x] -= 1
            if on: 
                ans.append(diff)
                sums = ss0 
            else: 
                ans.append(-diff)
                sums = ss1
        return ans

class Solution:
    def minimumDifference(self, nums: List[int], k: int) -> int:


        minimal=float('inf')

        counter=defaultdict(int)

        maximum=float('-inf')
        minimum=float('inf')
        sortedArray=[]
        for num in nums:
            counter[num]+=1
            maximum=max(num,maximum)
            minimum=min(num,minimum)

        for i in range(minimum, maximum+1):
            if i in counter:
                while counter[i]:
                    sortedArray.append(i)
                    counter[i]-=1

        first=0
        second=k-1

        while second < len(sortedArray):
            minimal=min(minimal,sortedArray[second]-sortedArray[first])
            first+=1
            second+=1

        return minimal

