class Solution:
    def minSessions(self, tasks: List[int], sessionTime: int) -> int:
        n = len(tasks)

        @lru_cache(None)
        def dp(mask, t):
            if mask == (1 << n) - 1:
                return 0
            ans = n
            for i in range(n):
                if mask &amp; (1 << i): continue
                if tasks[i] > t:
                    ans = min(ans, 1 + dp(mask ^ (1 << i), sessionTime - tasks[i]))
                else:
                    ans = min(ans, dp(mask ^ (1 << i), t - tasks[i]))
            return ans

        return dp(0, 0)

