class Solution:
    def maxProduct(self, s: str) -> int:
        if len(s) < 2:
            return 0
        if len(s) == 2:
            return 1
        self.ans = -1
        visited = set()
        def dfs(arr1, arr2, idx):
            if tuple(sorted([arr1, arr2]) + [idx]) in visited:
                return
            visited.add(tuple(sorted([arr1, arr2]) + [idx]))
            if arr1 == arr1[::-1] and arr2 == arr2[::-1]:
                self.ans = max(self.ans, len(arr1) * len(arr2))
            if idx == len(s):
                return
            dfs(arr1+s[idx], arr2, idx+1)
            dfs(arr1, arr2+s[idx], idx+1)
            dfs(arr1, arr2, idx+1)
        dfs("", "", 0)
        return self.ans

class Solution:
    def smallestMissingValueSubtree(self, parents: List[int], nums: List[int]) -> List[int]:
        ans = [1] * len(parents)
        if 1 in nums: 
            tree = {}
            for i, x in enumerate(parents): 
                tree.setdefault(x, []).append(i)

            k = nums.index(1)
            val = 1
            seen = set()

            while k != -1: 
                stack = [k]
                while stack: 
                    x = stack.pop()
                    seen.add(nums[x])
                    for xx in tree.get(x, []): 
                        if nums[xx] not in seen: 
                            stack.append(xx)
                            seen.add(nums[xx])
                while val in seen: val += 1
                ans[k] = val
                k = parents[k]
        return ans

