class Solution:
    def secondMinimum(self, n: int, edges: List[List[int]], time: int, change: int) -> int:
        g = defaultdict(set)
        for u, v in edges:
            g[u].add(v)
            g[v].add(u)              

        q = deque([(1, 0)])
        # to store the two minimum node counts for each visited node
        vis = defaultdict(set, {0: {0}})
        minval = set()
        while q:
            node, cnt = q.popleft()
            if node == n:
                minval.add(cnt)
                if len(minval) == 2: break
            for nei in g[node]:
                if len(vis[nei]) > 1 and cnt + 1 >= max(vis[nei]): continue
                vis[nei] = {min(vis[nei])} | {cnt + 1} if vis[nei] else {cnt + 1}
                q.append((nei, cnt + 1))

        minval = sorted(minval)
        def helper(nodes):
            t = 0
            while nodes > 0:
                t += time
                nodes -= 1
                if nodes == 0: break
                # if current time exceeds change and change frequency is odd
                if t >= change and (t // change) % 2:
                    t = (t // change + 1) * change
            return t

        if len(minval) == 1:
            return helper(minval[0] + 2)

        # either use the 2nd minimum path or the 1st path add two more nodes (like example 2)
        return min(helper(minval[0]+2), helper(minval[1]))

class Solution:
    def countValidWords(self, sentence: str) -> int:
        valid = 0
        digits = set(string.digits)
        punctuation = set(['!', '.', ','])
        for token in sentence.split():
            ts = set(token)
            if digits &amp; ts:
                continue
            if p := punctuation &amp; set(ts):
                if len(p) > 1 or token[-1] not in punctuation:
                    continue
                if max(token.count(c) for c in punctuation) > 1:
                    continue
            if token.count('-') > 1:
                continue
            if token.count('-') == 1:
                idx = token.find('-')
                if idx == 0 or idx == len(token) - 1 or not token[idx-1].islower() or not token[idx+1].islower():
                    continue                
            valid += 1
        return valid

class Solution:
    def nextBeautifulNumber(self, n: int) -> int:

        def count(n):
            cnt = [0]*10
            while n:
                cnt[n%10] += 1
                n //= 10
            return cnt

        def valid(cnt):
            for i, c in enumerate(cnt):
                if c > 0 and c != i:
                    return False
            return True

        x = n+1
        while True:
            cnt = count(x)
            if valid(cnt):
                return x
            x += 1

class Solution:
    def countHighestScoreNodes(self, parents: List[int]) -> int:
        hmap=defaultdict(list)
        n=len(parents)
        for i in range(n):
            hmap[i]=[]
        for i in range(1,n):
            hmap[parents[i]].append(i)
        self.childCount=[1 for i in range(n)]
        for i in hmap[0]:
            self.childCount[0]+=self.dfs(i,hmap)
        ans=0
        count=0
        for i in range(n):
            currProd=1
            currSum=0
            for j in hmap[i]:
                currProd*=self.childCount[j]
                currSum+=self.childCount[j]
            rem=(n-1)-(currSum)
            if rem>=1:
                currProd*=rem
            if ans==currProd:
                count+=1
            if ans<currProd:
                count=1
                ans=currProd
        return count
    def dfs(self,curr,hmap):
        if hmap[curr]==[]:
            return 1
        for it in hmap[curr]:
            self.childCount[curr]+=self.dfs(it,hmap)
        return self.childCount[curr]

class Solution:
    def minimumTime(self, n: int, relations: List[List[int]], time: List[int]) -> int:

        g = defaultdict(set)
        deg = defaultdict(int)
        for a, b in relations:
            deg[b-1] += 1
            g[a-1].add(b-1)

        cnt = 0

        # time to finish all prerequisites
        prev_max_t = defaultdict(int)

        q = [(time[x], x) for x in range(n) if deg[x] == 0]
        heapify(q)

        while q:
            t, course = heappop(q)
            cnt += 1
            if cnt == n:
                return t
            for nei in g[course]:
                deg[nei] -= 1
                prev_max_t[nei] = max(prev_max_t[nei], t)
                if deg[nei] == 0:
                    heappush(q, (prev_max_t[nei] + time[nei], nei))

