class Solution:
    def nodesBetweenCriticalPoints(self, head: Optional[ListNode]) -> List[int]:
        '''
        5->3->1->2->5->1->2
              C     C. C
        c = [2,4,5]
        '''
        if head.next.next is None:
            return [-1,-1]

        def calc(head):
            prev = head
            temp = head.next
            while temp:
                next_node = temp.next
                if next_node is not None:
                    if prev.val > temp.val < next_node.val or prev.val < temp.val > next_node.val:
                        break
                    prev,temp = temp,next_node
                else:
                    break

            max_dis = 0
            min_dis = pow(10,5)+1
            count = 0
            mi_count = pow(10,5)+1
            while temp:
                next_node = temp.next
                if next_node is not None:
                    if prev.val > temp.val < next_node.val or prev.val < temp.val > next_node.val:
                        max_dis = count
                        min_dis = min(min_dis,mi_count)
                        mi_count = 0
                    count += 1
                    mi_count += 1
                    prev,temp = temp,next_node
                else:
                    break

            if max_dis != 0 and min_dis != pow(10,5)+1:        
                return [min_dis,max_dis]
            return [-1,-1]

        return calc(head)

class Solution:
    def minimumOperations(self, nums: List[int], start: int, goal: int) -> int:
        nums.sort()
        q = collections.deque([(start, 0)])
        visited = set()

        while q:
            for _ in range(len(q)):
                x, step = q.popleft()
                if x == goal:
                    return step

                if x < 0 or x > 1000:
                    continue

                if x in visited:
                    continue
                visited.add(x)

                for num in nums:
                    q.append((x+num, step+1))
                    q.append((x-num, step+1))
                    q.append((x^num, step+1))


        return -1

class Solution:
    def possiblyEquals(self, s1: str, s2: str) -> bool:

        def gg(s): 
            """Return possible length."""
            ans = {int(s)}
            for i in range(1, len(s)): 
                ans |= {x+y for x in gg(s[:i]) for y in gg(s[i:])}
            return ans

        @cache
        def fn(i, j, diff): 
            """Return True if s1[i:] matches s2[j:] with given differences."""
            if i == len(s1) and j == len(s2): return diff == 0
            if i < len(s1) and s1[i].isdigit(): 
                ii = i
                while ii < len(s1) and s1[ii].isdigit(): ii += 1
                for x in gg(s1[i:ii]): 
                    if fn(ii, j, diff-x): return True 
            elif j < len(s2) and s2[j].isdigit(): 
                jj = j 
                while jj < len(s2) and s2[jj].isdigit(): jj += 1
                for x in gg(s2[j:jj]): 
                    if fn(i, jj, diff+x): return True 
            elif diff == 0: 
                if i < len(s1) and j < len(s2) and s1[i] == s2[j]: return fn(i+1, j+1, 0)
            elif diff > 0: 
                if i < len(s1): return fn(i+1, j, diff-1)
            else: 
                if j < len(s2): return fn(i, j+1, diff+1)
            return False 

        return fn(0, 0, 0)

class Solution:
