class Solution:
    def minMoves(self, target: int, maxDoubles: int) -> int:
        step = 0
        while target != 1  :
            if target % 2 == 1:
                if maxDoubles == 0:
                    step += target -1
                    target = 1
                else:
                    target -= 1
                    step +=1
            else:
                if maxDoubles > 0:
                    target = target/ 2
                    step +=1
                    maxDoubles -=1
                else:
                    step +=1
                    target -=1
        return int(step)

class Solution:
    def mostPoints(self, questions: List[List[int]]) -> int:
        n = len(questions)

        # set dp array
        dp = [0]*n

        # start from last
        dp [-1] = questions[-1][0]

        # start setting the rest
        for i in reversed(range(n-1)):
            points, skip = questions[i]

            # dp formula
            if i + skip + 1 < n : dp[i] = max(dp[i+1], points + dp[i + skip + 1])
            else: dp [i] = max(points, dp[i+1])

        return dp[0]

class Solution:
    def maxRunTime(self, n: int, batteries: List[int]) -> int:
        l, h = min(batteries), sum(batteries)

        batteries.sort()
        cands = batteries[-n:]
        rest = sum(batteries[:-n])

        def bs(t):
            tmp = rest
            for x in cands:
			    # all rest batteries on computer can run more than t time
                if x >= t: return True
				# need t - x batteries to fill
                tmp -= t - x
				if tmp < 0: return False
            return True


        while l < h:
            mid = l + (h - l + 1) // 2
            if bs(mid):
                l = mid
            else:
                h = mid  - 1

        return l

