def cost(mins, secs, startAt, moveCost, pushCost):
    cost = 0
    has_prev = False

    for digit in [mins // 10, mins % 10, secs // 10, secs % 10]:
        if has_prev or digit != 0:
            if digit != startAt:
                cost += moveCost
                startAt = digit
            cost += pushCost
            has_prev = True

    return cost

