class Solution:
    def numberOfWays(self, s: str) -> int:
        def find_subsequence_count(S, T):
            m = len(T)
            n = len(S)
            if m > n:
                return 0
            mat = [[0 for _ in range(n + 1)]
                   for __ in range(m + 1)]
            for i in range(1, m + 1):
                mat[i][0] = 0
            for j in range(n + 1):
                mat[0][j] = 1
            for i in range(1, m + 1):
                for j in range(1, n + 1):
                    if T[i - 1] != S[j - 1]:
                        mat[i][j] = mat[i][j - 1]
                    else:
                        mat[i][j] = (mat[i][j - 1] +
                                     mat[i - 1][j - 1])
            return mat[m][n]
        x = find_subsequence_count(s, '101')
        y = find_subsequence_count(s, '010')
        return x + y

class Solution:
    def sumScores(self, s: str) -> int:
        n, l, r = len(s), 0, 0
        z = [0] * n
        for i in range(1, n):
            if i <= r:
                z[i] = min(r - i + 1, z[i - l])
            while i + z[i] < n and s[z[i]] == s[i + z[i]]:
                z[i] += 1
            if i + z[i] - 1 > r:
                l, r = i, i + z[i] - 1
        return sum(z)+len(s)

