                    cur_res = int(int1[:i]) * (int(int1[i:]) + int(int2[:j]))
                elif i == 0 and j == sec_limit:
                    continue
                else:
                    cur_res = int(int1[:i]) * (int(int1[i:]) + int(int2[:j])) * int(int2[j:])

