    def removeDigit(self, number: str, digit: str) -> str:
        res_nums = set()
        pos = 0
        for i in range(number.count(digit)):
            ind = number.index(digit, pos, len(number))
            res = number[:ind] + number[ind+1:]
            if int(res) not in res_nums:
