          if t >= 3 and pressedKeys[t-2] == target and pressedKeys[t-3] == target:
            res += grid[t-3]
          if t >= 4 and pressedKeys[t-2] == target and pressedKeys[t-3] == target and pressedKeys[t-4] == target:
            res += grid[t-4]

        grid[t] = res % (10**9 + 7)
      return grid[-1] % (10**9 + 7)

class Solution:
    def hasValidPath(self, grid: List[List[str]]) -> bool:
      m, n = len(grid), len(grid[0])

      if grid[0][0] == ')': return False
      else:

        @lru_cache(None)
        def helper(x, y, acc):
          if x == m-1 and y == n-1:
            if grid[x][y] == ')':
              if acc == 1: return True
              else: return False
          else:
            if grid[x][y] == ')':
              if acc == 0: return False
              else:
                if x < m-1:
                  res = helper(x+1, y, acc-1)
                  if res: return True
                if y < n-1:
                  res = helper(x, y+1, acc-1)
                  if res: return True
                return False
            else:
              acc += 1
              if x < m-1:
                res = helper(x+1, y, acc)
                if res: return True
              if y < n-1:
                res = helper(x, y+1, acc)
                if res: return True
              return False

        return helper(0, 0, 0)

