class Solution:
    def maximumWhiteTiles(self, tiles: List[List[int]], carpetLen: int) -> int:
        if not carpetLen or not tiles: return 0
        def get_next(itl, lf, rt):
            if itl < lf - 1:
                next_itr = lf - 1
            elif itl == lf - 1:
                next_itr = lf
            elif lf <= itl < rt:
                next_itr = rt
            elif itl == rt:
                next_itr = rt + 1
            else:
                next_itr = itl + 1
            return next_itr
        tiles.sort()
        itl = -1
        itr = 0
        iwl = iwr = 0
        nw = 0
        max_w = 0
        max_iter = tiles[-1][1]
        prev_itr = -1
        while itr  < (tiles[-1][1] + 1):
            itl = itr - carpetLen
            njump = itr - prev_itr

            if njump == 1:
                while itr > tiles[iwr][1] and iwr < len(tiles) - 1:
                    iwr += 1
                lf, rt = tiles[iwr]
                if lf <= itr <= rt:
                    nw += 1

                next_itr = get_next(itr, lf, rt)
                if itl >= 0:
                    while itl > tiles[iwl][1] and iwl < len(tiles) - 1:
                        iwl += 1
                    lf, rt = tiles[iwl]
                    if lf <= itl <= rt:
                        nw -= 1
                    next_itr2 = get_next(itl, lf, rt) + carpetLen
                else:
                    next_itr2 = math.inf
                prev_itr = itr
                itr = min(next_itr, next_itr2)
            else:
                lf, rt = tiles[iwr]
                if lf <= prev_itr <= rt:
                    nw += itr - prev_itr
                if prev_itr - carpetLen >= 0:
                    lf, rt = tiles[iwl]
                    if lf <= prev_itr - carpetLen <= rt:
                        nw -= itr - prev_itr   
                prev_itr = itr
                itr += 1
            max_w = max(max_w, nw)
        return max_w

class Solution:
    def largestVariance(self, s: str) -> int:
        counter = Counter(s)
        res = 0

        for a, b in permutations(counter, 2):
            count_a, count_b = 0, 0
            remain_b = counter[b]
            for ch in s:
                if ch not in {a, b}:
                    continue
                if ch == a:
                    count_a += 1
                elif ch == b:
                    count_b += 1
                    remain_b -= 1
                # Kadane's Algorithm, modified
                if count_a < count_b and remain_b > 0:
                    count_a, count_b = 0, 0
                if count_b > 0:
                    res = max(res, count_a - count_b) 

        return res

