        return ans

class Solution:
    def minPathCost(self, grid: List[List[int]], moveCost: List[List[int]]) -> int:
        m = len(grid)
        n = len(grid[0])
        dic = defaultdict(list)
        lastRow = set(grid[-1])

        for i in range(m*n):
            for j in range(n):
                if i in lastRow:
                    continue
                else:
                    # (cost, dest_col)
                    dic[i].append((moveCost[i][j], j))

        dp = [[float('inf')] * n for _ in range(m)]

        for i in range(n):
            dp[0][i] = grid[0][i]

        for i in range(m-1):
            for j in range(n):
                start = grid[i][j]
                for cost, dest_col in dic[start]:
                    dp[i + 1][dest_col] = min(dp[i + 1][dest_col], dp[i][j] + cost + grid[i + 1][dest_col])

        return min(dp[-1])

class Solution:
    def distributeCookies(self, cookies: List[int], k: int) -> int:
        ans = sum(cookies)
        N = len(cookies)
        total = [0]*k

        def backtrack(i, total):
            nonlocal ans
            if i == N:
                ans = min(ans, max(total))
                return

            if max(total) >= ans:
                return

            for j in range(k):
                total[j] += cookies[i]
                backtrack(i+1, total)
                total[j] -= cookies[i]


        backtrack(0, total)
        return ans

