    def equalPairs(self, grid: List[List[int]]) -> int:
        root = {}
        n = len(grid)
        for i in range(n):
            tmp = root
            for j in range(n):
                if grid[i][j] not in tmp:
                    tmp[grid[i][j]] = {}
                tmp = tmp[grid[i][j]]
            if '#' in tmp:
                tmp['#'] += 1
            else:
                tmp['#'] = 1

        numPair = 0
        for j in range(n):
            tmp = root
            for i in range(n):
                if grid[i][j] not in tmp:
                    break
                tmp = tmp[grid[i][j]]
            if '#' in tmp:
                numPair += tmp['#']

        return numPair

