class Solution:
    def closestMeetingNode(self, edges: List[int], node1: int, node2: int) -> int:
        ## RC ##
        ## APPROACH: GRAPH ##
        ## LOGIC ##
        ## 1. Typical Graph problem, just do what the question asks
        ## 2. Watch out for race conditions, a) when no common node b) multiple paths for the same node
        graph = collections.defaultdict(list)
        for u, v in enumerate(edges):
            if v != -1:
                graph[u].append(v)

        res = float('inf')
        ans = -1
        visited1 = {}
        def dfs1(node, d):
            nonlocal res
            nonlocal ans
            if node == node2:
                res=min(res, d)
                ans=node
            if node in visited1:
                if visited1[node] > d:
                    visited1[node] = d
                return
            visited1[node] = d
            if node in graph:    
                dfs1(graph[node][0], d +1)

        dfs1(node1, 0)

        visited2 = {}
        def dfs2(node, d):
            nonlocal res
            nonlocal ans
            if node == node1:
                if res > d:         # if already found in first node, then check for max distance
                    res = d
                    ans=node
            if node in visited2:
                if visited2[node] > d:
                    visited2[node] = d
                return
            visited2[node] = d
            if node in graph:    
                dfs2(graph[node][0], d +1)

        dfs2(node2, 0)
        for node in sorted(visited1.keys()):
            if node in visited2:
                if max(visited1[node], visited2[node]) < res:
                    res = max(visited1[node], visited2[node])
                    ans = node
        return ans

class Solution:
    def longestCycle(self, edges: List[int]) -> int:

        ans = -1

        def checkLoop(start):
            temp = {}
            count = 0
            while start != -1:
                if start in temp:
                    return count - temp[start]
                elif start in visited:
                    return -1

                visited.add(start)
                temp[start] = count
                count += 1
                start = edges[start]
            return -1

        visited = set()

        for value in edges:
            if value in visited:
                continue
            else:
                ans = max(ans, checkLoop(value))

        return ans

