class Solution:
    def reachableNodes(self, n: int, edges: List[List[int]], restricted: List[int]) -> int:
        g = defaultdict(list)
        restrict = set(restricted)

        for u, v in edges:
            g[u].append(v)
            g[v].append(u)

        seen = set()
        stack = [0]
        res = 0

        while stack:
            node = stack.pop()

            if node not in seen:
                res += 1
                seen.add(node)

            for adj in g[node]:
                if adj not in seen and adj not in restrict:
                    stack.append(adj)

        return res

