class Solution:
    def goodIndices(self, nums: List[int], k: int) -> List[int]:
        n=len(nums)
        left=[False for i in range(n)]
        right=[False for i in range(n)]
        ls,rs=-1,n
        for i in range(1,n):
            if i>=k:
                if i-ls>k:
                    left[i]=True
            if nums[i]>nums[i-1]:
                ls=i-1
        for j in range(n-2,-1,-1):
            if j<n-k:
                if rs-j>k:
                    right[j]=True
            if nums[j]>nums[j+1]:
                rs=j+1
        ans=[]
        for i in range(n):
            if left[i] and right[i]:
                ans.append(i)
        return ans

