class Solution:
    def maxSum(self, grid: List[List[int]]) -> int:
        m = len(grid); n = len(grid[0])

        def hourglassSum(i: int, j: int) -> int:
            return sum(grid[i - 1][j - 1:j + 2]) + grid[i][j] + sum(grid[i + 1][j - 1:j + 2])

        maxSum = 0
        for i, j in product(range(1, m - 1), range(1, n - 1)):
            maxSum = max(maxSum, hourglassSum(i, j))

        return maxSum

class Solution:
    def minimizeXor(self, num1: int, num2: int) -> int:        
        bits2 = bin(num2)[2:].count("1")
        bin1 = bin(num1)[2:]

        if len(bin1) <= bits2:
            return (1 << bits2) - 1

        ans = 0
        for i in range(len(bin1)):
            if bin1[i] == "1":
                ans |= 1 << (len(bin1) - i - 1)
                bits2 -= 1
            if bits2 == 0:
                return ans

        for i in range(len(bin1)):
            if bin1[~i] == "0":
                ans |= 1 << i
                bits2 -= 1
            if bits2 == 0:
                return ans

class Solution:
    def deleteString(self, s: str) -> int:
        n = len(s)

        if len(set(s)) == 1:
            return n

        @cache
        def dp(i: int = 0) -> int:
            if i == n - 1:
                return 1
            maxOperations = 0
            for l in range(1, (n - i) // 2 + 1):
                if s[i : i + l] == s[i + l:i + 2 * l]:
                    maxOperations = max(maxOperations, dp(i + l))
            return maxOperations + 1

        return dp()

