class Solution:
    def destroyTargets(self, nums: List[int], space: int) -> int:
        hmap=defaultdict(list)
        for i in nums:
            if i%space in hmap:
                occ,val=hmap[i%space]
                hmap[i%space]=[occ+1,min(val,i)]
            else:
                hmap[i%space]=[1,i]
        value=-float('inf')
        ans=-1
        for i,j in hmap.items():
            if j[0]>value:
                value=j[0]
