        for i in range(len(nums)):
            while st2 and nums[-st2[0]]<nums[i]:
                ans[-heappop(st2)]=nums[i]
            while st1 and nums[st1[-1]]<nums[i]:
                heappush(st2,-st1.pop())
            st1.append(i)
        return ans

