                nums[i] *= 2
                nums[i+1] = 0 
            if nums[i]: ans.append(nums[i])
        return ans + [0]*(len(nums)-len(ans))

class Solution:
    def maximumSubarraySum(self, nums: List[int], k: int) -> int:
        left, right = 0,0
        max_sum = 0
        n = len(nums)
        seen = {}
        current_sum = 0
        while right<n:
            seen[nums[right]] = seen.get(nums[right], 0)+1
            current_sum += nums[right]
            if right-left+1 == k:
                if len(seen) == k:
                    max_sum = max(max_sum, current_sum)
                if seen[nums[left]]>1:
                    seen[nums[left]]-=1
                else:
                    del seen[nums[left]]
                current_sum-=nums[left]
                left+=1
            right+=1

        return max_sum

class Solution:
    def totalCost(self, costs: List[int], k: int, candidates: int) -> int:
        n = len(costs)
        first = []
        last = []
        res = 0
        l = 0
        r = len(costs) - 1
        for i in range(candidates):
            heapq.heappush(first, costs[l])
            heapq.heappush(last, costs[r])
            l += 1
            r -= 1
            if l + 1 > r:
                break
        for i in range(k):
            if not last or (first and first[0] <= last[0]):
                res += heapq.heappop(first)
                if l <= r:
                    heapq.heappush(first, costs[l])
                    l += 1
            elif not first or (last and last[0] < first[0]):
                res += heapq.heappop(last)
                if r >= l:
                    heapq.heappush(last, costs[r])
                    r -= 1
        return res

class Solution {
    public long totalCost(int[] costs, int k, int candidates) {
        int n  = costs.length;
        Queue<Integer> first = new PriorityQueue<>();
        Queue<Integer> last = new PriorityQueue<>();
        long res = 0;
        int l = 0;
        int r = n - 1;
        for (int i = 0; i < candidates; i ++) {
            first.offer(costs[l]);
            last.offer(costs[r]);
            l ++;
            r --;
            if (l + 1 > r) {
                break;
            }
        }
        for (int i = 0; i < k; i ++) {
            if (last.isEmpty() || (!first.isEmpty() &amp;&amp; first.peek() <= last.peek())) {
                res += (long)first.poll();
                if (l <= r) {
                    first.offer(costs[l]);
                    l ++;
                }
            } else if (first.isEmpty() || (!last.isEmpty() &amp;&amp; last.peek() < first.peek())) {
                res += (long)last.poll();
                if (r >= l) {
                    last.offer(costs[r]);
                    r --;
                }
            }
        }
        return res;
    }
}

class Solution:
    def distinctAverages(self, nums: List[int]) -> int:

        ans = set()
        nums.sort()
        queue = deque(nums)

        while queue:
            low = queue.popleft()
            high = queue.pop()
            ans.add((low+high)/2)

        return len(ans)

class Solution:
    def countGoodStrings(self, low: int, high: int, zero: int, one: int) -> int:
        dp = [0]*(high+1)
        dp[zero] += 1
        dp[one] += 1
        mod = (10**9)+7
        for i in range(min(zero,one)+1,high+1):
            if i-zero>=0:
                dp[i]+=dp[i-zero]
            if i-one>=0:
                dp[i]+=dp[i-one]
        s = 0
        for i in range(low,high+1):
            s+=dp[i]
        return s%mod

class Solution:
    def mostProfitablePath(self, edges: List[List[int]], bob: int, amount: List[int]) -> int:
        graph = defaultdict(list)

        for edge in edges:
            graph[edge[0]].append(edge[1])
            graph[edge[1]].append(edge[0])

        def bob_dfs(curr_node, prev_node, count):
            if curr_node == 0:
                return count
            if prev_node != None and len(graph[curr_node]) == 1 and curr_node != 0:
                return -1

            for node in graph[curr_node]:
                if node == prev_node:
                    continue
                res = bob_dfs(node, curr_node, count + 1)
                if res != -1:
                    if count < (res + 1) // 2:
                        amount[curr_node] = 0
                    if res % 2 == 0 and res // 2 == count:
                        amount[curr_node] /= 2
                    return res
            return -1  

        bob_dfs(bob, None, 0)
        leafs_res = []

        def sum_dfs(curr_node, curr_sum, prev_node):
            if len(graph[curr_node]) == 1 and curr_node != 0:
                leafs_res.append(curr_sum + amount[curr_node])

            for node in graph[curr_node]:
                if node == prev_node:
                    continue
                sum_dfs(node, curr_sum + amount[curr_node], curr_node)

        sum_dfs(0, 0, None)

        res = max(leafs_res)
        if res % 1 == 0:
            return int(res)
        else:
            return res

class Solution:
    def splitMessage(self, message: str, limit: int) -> List[str]:
        n = len(message)
        best = math.inf
        def check(x):
            avail = 0
            start = 1
            while start <= x:
                next_start = start * 10
                suffix = f"<{start}/{x}>"
                if len(suffix) > limit:
                    return False
                avail += (min(next_start - 1, x) - start + 1) * (limit - len(suffix))
                start = next_start
            last_suffix = f"<{x}/{x}>"
            return avail >= n >= avail - (limit - len(last_suffix))

        for n_part in range(1, n + 1):
            if check(n_part):
                break
        else:
            return []

        ans = []
        start = 0
        for i in range(1, n_part + 1):
            suffix = f"<{i}/{n_part}>"
            next_start = start + limit - len(suffix)
            ans.append(message[start:next_start] + suffix)
            start = next_start
        return ans

class Solution:
    def convertTemperature(self, celsius: float) -> List[float]:
        return [celsius + 273.15, celsius * 1.80 + 32.00]

class Solution:
    def subarrayLCM(self, nums: List[int], k: int) -> int:
        num_subarray = 0
        n = len(nums)
        for i in range(n):
            lcm = nums[i]
            for j in range(i, n):
                lcm = math.lcm(lcm, nums[j])
                if lcm > k:
                    break
                else:
                    num_subarray += (lcm == k)
        return num_subarray

class Solution:
    def countswaps(self, arr):
        count = 0
        temp = sorted(arr)
        h = {}

        for i in range(len(arr)):
            h[arr[i]] = i

        for i in range(len(arr)):
            if arr[i] != temp[i]:
                count += 1

                # swap to correct place
                j = h[temp[i]]

                h[arr[i]], h[arr[j]] = j, i
                arr[i], arr[j] = arr[j], arr[i]

        return count


    def minimumOperations(self, root: Optional[TreeNode]) -> int:
        q = collections.deque()
        q.append(root)
        ans = 0

        while q:
            size = len(q)
            level = []
            for _ in range(size):
                temp = q.popleft()
                level.append(temp.val)

                if temp.left:
                    q.append(temp.left)
                if temp.right:
                    q.append(temp.right)

            ans += self.countswaps(level)

        return ans

class Solution:
    def maxPalindromes(self, s: str, k: int) -> int:
        n = len(s)
        vals = [1]*n
        for i in range(2*n-1): 
            lo, hi = i//2, (i+1)//2
            while 0 <= lo <= hi < n and s[lo] == s[hi]: 
                if vals[lo] < k: vals[lo] = max(vals[lo], hi-lo+1)
                lo -= 1
                hi += 1
        dp = [0]*(n+1)
        for i in range(n-1, -1, -1): 
            dp[i] = dp[i+1]
            if vals[i] >= k: dp[i] = max(dp[i], 1+dp[i+vals[i]])
        return dp[0]

class Solution:
    def unequalTriplets(self, nums: List[int]) -> int:
        n = len(nums)
        res = 0
        for i in range(n - 2):
            for j in range(i + 1, n - 1):
                for k in range(j + 1, n):
                    if nums[i] != nums[j] and nums[i] != nums[k] and nums[j] != nums[k]:
                        res += 1
        return res



class Solution {
    public int unequalTriplets(int[] nums) {
        int n = nums.length;
        int res = 0;
        for (int i = 0; i < n - 2; i ++) {
            for (int j = i + 1; j < n - 1; j ++) {
                for (int k = j + 1; k < n; k ++) {
                    if (nums[i] != nums[j] &amp;&amp; nums[i] != nums[k] &amp;&amp; nums[j] != nums[k]) {
                        res ++;
                    }
                }
            }
        }
        return res;
    }
}

class Solution:
    def beautifulPartitions(self, s: str, k: int, minLength: int) -> int:
        s=list(s)
        l0=len(s)
        prime={'2', '3', '5', '7'}
        for i in range(l0):
            s[i]=s[i] in prime
        if not s[0]:
            return 0
        if s[-1]:
            return 0
        p=10**9+7
        stops=[0]
        for i in range(l0-1):
            if (not s[i]) and s[i+1]:
                stops.append(i+1)
        l1=len(stops)

        def bp(i, k):
            if l0-stops[i]<k*minLength:
                return 0
            if k==1:
                return 1                    
            i1=i+1
            while i1<l1 and stops[i1]<stops[i]+minLength:
                i1+=1
            return sm[i1]%p

        for j in range(1, k+1):
            table=[bp(i, j) for i in range(l1)]
            sm=[]
            tmp=0
            for t in table:
                sm.append(tmp)
                tmp+=t
            sm.append(tmp)
            for i in range(l1+1):
                sm[i]=tmp-sm[i]

        return table[0]

def factorial(n):
    if n <= 1:
        return 1
    return n * factorial(n-1)

def factorial(n):
    if n <= 1:
        return 1
    return n * factorial(n-1)
